import React from "react";
import { Navbar, NavbarBrand } from "reactstrap";

const Navigation = () => {
    return (
        <div>
            <Navbar color="dark" dark>
                <NavbarBrand href="/">Restaurant App</NavbarBrand>
            </Navbar>
        </div>
    )
}
export default Navigation;
